import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monster1: {
        name: "Frankenstein",
        health: 0,
        maxHealth: 0,
      }
    };
  }

  render() {
    return <div className="App"></div>;
  }
}

export default App;
